import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Outlet } from 'react-router-dom';

import Header from 'components/layouts/Header/Header';

import { getGarageLists } from 'store/modules/listReducer';

import styles from './App.module.scss';

function App () {
   const dispatch = useDispatch();
   const garageList = useSelector( store => store.list.garageList );
   
   useEffect(() => {
      dispatch( getGarageLists() ).then( ({ payload }) => {
         console.log('data: ', payload)
         if ( !payload.isFail ) sessionStorage.setItem( 'store', JSON.stringify({
            garagePage: 1,
            winnersPage: 1,
            garageList: garageList.map( car => ({ id: car.id, raceStatus: 'stopped' })),
         }));
      });
   }, [])
   
   return(
      <div className = "wrapper">
         <div className = "container">
            <Header />
            <Outlet />
         </div>
      </div>
   )
}

export default App;
